een goeie film

met Jason Statham, Leelee Sobieski en John Rhys-Davies

Tegen de achtergrond van de oorlog in het Koninkrijk Ehb, tussen de koning Konreid en de slechterik Gallian, is dit het verhaal 
over Farmer, een eenvoudige familieman, die zijn ontvoerde vrouw tracht te vinden. Tevens wil hij wraak op de moordenaars van 
zijn zoon; enkele dierlijke krijgers genaamd Krugs. Gebaseerd op een populaire game.
